data.text:
@AngrierWHStaff It's shredding the tenants of our democracy.
Throwing shade on the integrity of our elections that have been occurring for 244 years. 
That's the harm.

@benigma2017 @eyemsimone @AOC @JoeBiden I wasn’t being that literal but you are a significant and respected voice. I think your shade stings more than you imagine. 

But honestly I can’t see through the fog of it. Had Joe lost and had AOC been perceived as a factor would that be better for us? 
I truly don’t know.
